import React from 'react';

const Imagen = (props) => {
    console.log(props.imagen.previewUrl)
    return(
        <div className="col-12 col-sm-6 col-md-4 col-lg-3 mb-4">
            <div className="card">
                <img src={props.imagen.previewUrl}/>
            </div>
        </div>
    )
}

export default Imagen;
